import React, { Component } from 'react';
import AddressCard from '../Cards/AddressCard';
import ADDRESS_DATA from '../Data/AddressData';
import Typography from '@material-ui/core/Typography'

class AddressList extends Component {
    constructor(props) {
        super(props);

        this.state = {
            addresses : ADDRESS_DATA
        }
    }
    render() {
        const { addresses } = this.state;
        return (
            <div>
            <div className='ml-4 mb-2 md:mb-4 text-indigo-400 md:ml-4 text-4xl font-medium'> 
                       Our Offices </div>
    <div className='md:flex md:pl-4'>
               {addresses.map(({name,address,imageUrl,id}) => (
                   <div className='md:mr-4 mb-4'>
                   <AddressCard key={id} address={address} name={name} imageUrl={imageUrl}/>
                   </div>
               ))
               }
            </div>
            </div>
        )
    }
}

export default AddressList;
